import React, { Component } from 'react';
import Layout from '../../components/Layout';

class QuejaNueva extends Component {
    render() {
        return (
            <Layout>
            <h1>Nueva Queja</h1>
            </Layout>
        );
    }
}

export default QuejaNueva;
